atment',1,NULL,123,'Spray of insecticide,its quantity and method is shown\r\n','','','',NULL,NULL,'','2009-09-02','2009-09-02',1,'','','','',71,63,59,NULL,NULL,NULL,1,'','I','2010-02-01 22:52:52'),(25,'Brinjal Insecticidal Treatment',1,NULL,125,'Spray of insecticide,its quantity and method is shown\r\n','','','',NULL,NULL,'','2009-09-02','2009-09-02',1,'','','','',71,59,63,NULL,NULL,NULL,1,'','I','2010-02-01 23:36:26'),(26,'Tomato Sowing',1,NULL,123,'Sowing of tomato from nursery bed,its method,and application of fertilizer is shown.\r\n','','','',NULL,NULL,'','2009-09-03','2009-09-03',1,'','','','',72,63,59,NULL,NULL,NULL,1,'','I','2010-02-01 23:59:39'),(27,'Radish Nursery Bed',1,NULL,125,'Nursery bed preperation of radish with amout of fertilizer required and metod of bed preperation is shown.\r\n','','','',NULL,NULL,'','2009-09-03','2009-09-03',1,'','','','',73,59,63,NULL,NULL,NULL,1,'','I','2010-02-02 00:07:30'),(28,'Pumpkin earthing up',1,NULL,123,'Earthing up operation in pumpkin and its fertilizer application.\r\n','','','',NULL,NULL,'','2009-09-12','2009-09-12',1,'','','','',74,58,78,NULL,NULL,NULL,1,'','I','2010-02-02 00:24:42'),(29,'Insecticidal Treatment in Paddy',1,NULL,125,'Treatment of insecticide,its quantity,and method of application is shown.\r\n','','','',NULL,NULL,'','2009-09-13','2009-09-13',1,'','','','',70,78,58,NULL,NULL,NULL,1,'','I','2010-02-02 00:30:10'),(30,'20 days duck feed and treatment',1,NULL,125,'Feeding and treatment of 20 days old duck is shown.Precaution to be taken is also shown\r\n','','','',NULL,NULL,'','2009-09-13','2009-09-13',1,'','','','',62,59,63,NULL,NULL,NULL,1,'','I','2010-02-02 00:32:52'),(31,'20 days duck feed and treatment',1,NULL,123,'Feeding and treatment of 20 days old duck is shown.Precaution to be taken is also shown\r\n','','','',NULL,NULL,'','2009-09-13','2009-09-13',1,'','','','',62,63,59,NULL,NULL,NULL,1,'','I','2010-02-02 00:34:49'),(32,'Feeding of fish',1,NULL,125,'It deals with feeding of fish,its method,dose and time of feeding.It is shown by SHG Group.\r\n','','','',NULL,NULL,'','2009-10-12','2009-10-12',1,'','','','',76,59,63,NULL,NULL,NULL,1,'','G','2010-02-02 00:39:58'),(33,'Fertilizer application in pea',1,NULL,125,'It shows the process and amount of fertilizer to be applied in green pea.The method to be followed and duration after which it should be applied\r\n','','','',NULL,NULL,'','2009-11-05','2009-11-05',1,'','','','',52,59,63,NULL,NULL,NULL,1,'','I','2010-02-02 00:43:14'),(34,'Tomato Sowing',1,NULL,125,'Process of sowing of tomato,fertilizer apllication while sowing is demonstrated.\r\n','','','',NULL,NULL,'','2009-10-20','2009-10-20',1,'','','','',52,63,59,NULL,NULL,NULL,1,'','I','2010-02-02 00:45:21'),(35,'Gram sowing',1,NULL,125,'Process and method applied in sowing of gram.Fertilizer and its dose has been discussed\r\n','','','',NULL,NULL,'','2009-10-22','2009-10-22',1,'','','','',52,63,59,NULL,NULL,NULL,1,'','I','2010-02-02 00:47:25'),(36,'Cauliflower sowing',1,NULL,125,'Process and method applied in sowing of cauliflower.Fertilizer and its dose has been discussed\r\n','','','',NULL,NULL,'','2009-10-22','2009-10-22',1,'','','','',71,59,63,NULL,NULL,NULL,1,'','I','2010-02-02 00:49:50'),(37,'Application of Jeevamrutha',1,NULL,125,'Method of application of Jeevamruta is shown and discussed.Its advantage on application to crop, duration and quantity applied is shown\r\n','','','',NULL,NULL,'','2009-10-24','2009-10-24',1,'','','','',52,59,63,NULL,NULL,NULL,1,'','I','2010-02-02 00:54:05'),(38,'Transplanting of chilli',1,NULL,125,'Transplanting of chilli from nursey bed to the field and its procedure and metods of transplanting has been dealt with.\r\n','','','',NULL,NULL,'','2009-08-07','2009-08-07',1,'','','','',55,59,63,NULL,NULL,NULL,1,'','I','2010-02-02 00:57:28'),(39,'Line sowing of Arhar',1,NULL,125,'It deals with sowing of arhar in line which maintains proper spacing and uniformity resulting in higher yield\r\n','','','',NULL,NULL,'','2009-07-23','2009-07-23',1,'','','','',77,63,59,NULL,NULL,NULL,1,'','I','2010-02-02 01:01:17'),(40,'Fertilizer application in paddy',1,NULL,123,'It deals with application of fertilizer using rope which helps in saving fertilizer as well as proper application of fertilizer is shown.\r\n','','','',NULL,NULL,'','2009-07-23','2009-07-23',1,'','','','',72,78,63,NULL,NULL,NULL,1,'','I','2010-02-02 01:04:27'),(41,'Earthing up in Chilli',1,NULL,123,'','','','',NULL,NULL,'','2009-07-23','2009-07-23',1,'','','','',72,63,59,NULL,NULL,NULL,1,'','I','2010-02-02 01:06:37'),(42,'Cauliflower sowing',1,NULL,132,'Sowing of cauliflower is shown in nursery bed with complete methodology invoved in sowing.\r\n','','','',NULL,NULL,'','2009-07-24','2009-07-24',1,'','','','',78,63,59,NULL,NULL,NULL,1,'','I','2010-02-02 01:09:20'),(43,'Bhindi Earthing up',1,NULL,125,'earthing up in bhindi is shown and describes the benefits of earthing up in chilli as well as complete procedure.\r\n','','','',NULL,NULL,'','2009-07-27','2009-07-27',1,'','','','',79,58,63,NULL,NULL,NULL,1,'','I','2010-02-02 01:11:22'),(44,'Brinjal Earthing up',1,NULL,125,'Earthing up in brinjal is shown and describes the benefits of earthing up in chilli as well as complete procedure.\r\n','','','',NULL,NULL,'','2009-07-24','2009-07-24',1,'','','','',79,63,58,NULL,NULL,NULL,1,'','I','2010-02-02 01:20:51'),(45,'Ways of keeping duck',1,NULL,125,'','','','',NULL,NULL,'','2009-08-23','2009-08-23',1,'','','','',62,59,63,NULL,NULL,NULL,1,'','I','2010-02-02 01:35:01'),(46,'Pea spray',1,NULL,125,'It shows the spray operation in pea.The dose,method and precautions taken while spraying is shown\r\n','','','',NULL,NULL,'','2009-11-16','2009-11-16',1,'','','','',52,63,59,NULL,NULL,NULL,1,'','I','2010-02-02 01:38:47'),(47,'Brinjal earthing up',1,NULL,125,'Earthing up operation in brinjal is shown.It shows the fertilizer application while earthing up operation and duration of application\r\n','','','',NULL,NULL,'','2009-11-17','2009-11-17',1,'','','','